import { Component } from "./Component";
import { useGlobalContext } from "./context";
import { useRef } from "react";
const AllComponents = () => {
  const inputRef = useRef();
  const add = () => {
    let col = inputRef.current.value;
    addCol(col);
  };
  return (
    <section>
      <table>
        <tr>
          <th>to do</th>
          <th>doing</th>
          <th>done</th>
        </tr>
        <tr>
          <Component name="todo" />
          <Component name="doing" />
          <Component name="done" />
          {
            <>
              <input ref={inputRef} name="input" type="text" />
              <button onClick={add}>add</button>
            </>
          }
        </tr>
      </table>
    </section>
  );
};

export default AllComponents;
